import React from "react";
import {Table} from "react-bootstrap";

import "./graph.css";

const formCard = () => {
  return (
    <div className=" graph-card-container">
      <div className="graph-card-wrapper">
        <div className="graph_card_module"></div>
        <div className="graph_table_div">
          <Table>
            <tr>
              <td></td>
              <td></td>
              <td></td>
              <td></td>
            </tr>
            <tr></tr>
</Table>
        </div>
        <div></div>
      </div>
    </div>
  );
};
export default formCard;
